import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M21.41 11.41l-2.82-2.82A2 2 0 0017.17 8H6.83a2 2 0 00-1.42.59l-2.82 2.82A2 2 0 002 12.83V14a2 2 0 002 2h16a2 2 0 002-2v-1.17a2 2 0 00-.59-1.42zM17 12a.75.75 0 01-.75.75h-8.5a.75.75 0 110-1.5h8.5A.76.76 0 0117 12z", fill: primaryFill }));
};
const PortHdmi24Filled = wrapIcon(rawSvg({}), 'PortHdmi24Filled');
export default PortHdmi24Filled;
